e do with user data</h3><h3>Industry regulatory disclosure requirements</h3>', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2018-06-27 12:51:36', '2018-06-27 12:51:36', '', 3, 'http://localhost/ACFFieldsDemo/2018/06/27/3-revision-v1/', 0, 'revision', '', 0),
